package codefight;

public class String2_2 {
	static int findFirstSubstringOccurrence(String s, String x) {
		int result = -1;
		int j = 0;
		for(int i = 0; i < s.length(); i++) {
			j = 0;
			if(s.length() == x.length()) {
				if(x.equals(s) == false) return -1;
			}
			if(s.length() < x.length()) return -1;
			if(i + x.length() > s.length()) return -1;
			if(s.charAt(i) == x.charAt(j)) {
				if(x.equals(s.substring(i, i + x.length())) ==true)
					return i;
			}
		}
		return result;
	}

	public static void main(String[] args) {
		String s = "ATErUUeUkVFVNfxfUKtntOErKmZLUpWpHRASdxjUhzzxygmnNnKabPPgPqyvCLSCZObaNNGCXQssfEEDDJIPBwtkMmTniKapBlrd";
		String x = "vCLSCZObaNNGCXQssfEEDDJIPBwtkMmTniKa";
		System.out.println(findFirstSubstringOccurrence(s,x));
		
		String a0 = "";
		String x0 = "";
		String a1 = "";
		String x1 = "";
		String a2 = "";
		String x2 = "";
		String a3 = "";
		String x3 = "";
		
		System.out.printf("a0의 길이 : %d, x0의 길이 : %d, 판별 : %b\n",a0.length(),x0.length(),a0.equals(x0));
		System.out.printf("a1의 길이 : %d, x1의 길이 : %d, 판별 : %b\n",a1.length(),x1.length(),a1.equals(x1));
		System.out.printf("a2의 길이 : %d, x2의 길이 : %d, 판별 : %b\n",a2.length(),x2.length(),a2.equals(x2));
		System.out.printf("a3의 길이 : %d, x3의 길이 : %d, 판별 : %b\n",a3.length(),x3.length(),a3.equals(x3));
	}
}
